import { createGlobalStyle } from 'styled-components';

export default createGlobalStyle`
  * {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
    outline: none;
    font-family: Roboto, 'Helvetica Neue', sans-serif;
    --webkit-font-smoothing: antialiased !important;
  }

  html, body, #app {
    min-height: 100vh;
  }

  ul {
    list-style: none;
  }
`;
